import React from 'react';
import Navigation from '../components/Navigation';

const Formation = () => {
    return (
        <div className="formation">
            <Navigation/>
            <div className="formationContent">
            <ul>
                    <li>
                        <h1>DUT Informatique</h1>
                        <span>2019 -</span>
                        <img src="./media/didiland.jpg"></img>
                    </li>
                    <li>
                        <h1>Bac S - Sciences de l’Ingénieur</h1>
                        <span>2017 – 2019</span>
                    </li>
                    <li>
                        <h1>Brevet des collèges</h1>
                        <span>2015 – 2016</span>
                    </li>
                </ul>  
            </div>
        </div>
    );
};

export default Formation;
